                            shopItems:[
                                {
                                    itemId:3,
                                    itemName:"makita 18V drill",
                                    itemType:"power drill",
                                    brand:"makita",
                                    pictures:["somepicturelink1","somepicturelink2","somepicturelink3"],
                                    aditionalInfo:[{}]},
                                {
                                    itemId:4,
                                    itemName:"signet philips head screw driver",
                                    itemType:"screw driver",
                                    brand:"signet",
                                    pictures:["somepicturelink1","somepicturelink2","somepicturelink3"],
                                    aditionalInfo:[{}]}
                                ]}
                    
                        
                    
                        
            ]
        }
    }
    render() {
        const shops = [...this.state.dummyData.shops]

        return (
            <div>
            <h3>this is shops</h3>
            {shops.map(shop =>{
                return (
                    <div className={shop} key={shop.shopID}>
                        <h4>{shop.shopName}</h4>
                        <h4>{shop.shopTopic}</h4>
                    </div>
                )
            })}
        </div>
        )
    }
}
